INSERT INTO DYN_ELEMENT_CONFIG  (ELEMENT_ID,UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES (257,'PROPOSAL_BDGT_TTL_IN_KIND','Proposal Budget Total In Kind','343','DP303','In-Kind is the contribution of goods or services other than money. For KU budgeting purposes, in-kind shall be any cost that contributes to the delivery of the project, but not charged to the project, such as faculty time, graduate students and internal overhead. The value of such-in-kind contributions is captured as applicable in the budget and narrative to comprehensively demonstrate the resources dedicated to the project.',NULL,'fibi_admin',NOW());
