INSERT INTO DYN_ELEMENT_CONFIG  (ELEMENT_ID,UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES (259,'PROPOSAL_BDGT_DBDGT_C_ELEMNT','Proposal Budget Detailed budget Cost Share','310','DP303','Please select the cost element line items in order of the following categories as required: 1. Faculty, 2. Students, 3. Research Staff, 4. Direct Costs (Operational Expenses, Other Direct Costs, Sub-Contracts, Technical Consulting, Travel).',NULL,'fibi_admin',NOW());
