INSERT INTO DYN_ELEMENT_CONFIG  (ELEMENT_ID,UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES (262,'PROPOSAL_BDGT_DBDGT_EFFORT_%','Proposal Budget Detailed budget Effort','310','DP303','MANDATORY to enter % of Effort, percentate of time expected to spend on the project, whilst taking into account other duties such as teaching, research and management. Typical % of Effort values are: Faculty (up to 15% or as specified in grant call), Research Staff (100%), and, Graduate Students (100%). ',NULL,'fibi_admin',NOW());
